import Cookie from "js-cookie"
import React from "react"
import { message } from "antd"

export default function(Component) {
  function auth(props) {
    //   const history = useHistory()
    if (!Cookie.get("token")) {
      props.history.push("/")

      props.message.danger("로그인에 실패하셨습니다 다시 확인해주세요")
    }
    return <Component {...props} />
  }

  return auth
}
